import '../styles/Home.css'

const Home = () => {
    return (  
        <div className='container col content-container'>
            <div className='container row search-container'>
                This is where the search text will be.
            </div>
            <div className='container row random-container'>
                This is where the random text will be.
            </div>
        </div>
    );
}

export default Home;
